import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../App.css';

export default function Home(Login){
  const navigate=useNavigate();
  return(
    <div>
      <h1>This is Home Page</h1>
      <button onClick={()=>
        {if(Login===0){
          Login(1);
          navigate('/')}}}>Login</button>
    </div>
  )
}
